import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";


function App() {
    return (
        <div>
            <Header />
            {notes.map( (aNote) => {
    return <Note key={aNote.key} title={aNote.title} content={aNote.content} />
} )}
            <Footer />
        </div>

    );
}

export default App;
